import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Gym Membership", amount: 50.0, date: new Date(2022, 12, 19) },
    { title: "Pre-workout", amount: 25.0, date: new Date(2022, 12, 20) },
    { title: "Protein powder", amount: 50.0, date: new Date(2022, 12, 21) },
  ];
  return (
    <div>
      <h2>Fitness expenses</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
